import React from 'react';
import './App.css';
import del from '../delete.png'

function App() {
  return (
      <div className="wrap">
        <h3>My ToDo List!</h3>
        <form className="create-form">
          <input type="text" placeholder="Add Your Task.." />
            <button type="button" className="add">Add</button>
        </form>
        <ul className="todo-list list-unstyled" id="demo">
          <li className="todo-list__item">
            <input type="checkbox" />
              list-item
              <button className="delete"><img src={del} alt="delete" /></button>
          </li>
        </ul>
      </div>
);
}

export default App;
